import React from "react";

function WelcomeButtons() {
  return (
    <div>
      <button>Sign Up</button>
      <button onClick={() => setFormState("forgotPassword")}>
        Forgot Password
      </button>
      <button>Continue As Guest</button>
    </div>
  );
}

export default WelcomeButtons;
